import { Component } from '@angular/core';
import { UnityService } from '../unity.service';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  speed:number = 2;
  objectsAmount:number = 0;
  timeInSeconds:number = 0;

  constructor(private unityService:UnityService){
    this.testConnection()
  }

  async testConnection(){
    (await this.unityService.testConnection()).subscribe(value => console.log(value.message));
  }
}
<div class="columns">
  <div class="column">
    <div class="box mt-5">
      <div>
        <label class="label">Object speed</label>
        <input
          type="range"
          min="1"
          max="15"
          value="2"
          class="slider"
          id="myRange"
          [(ngModel)]="speed"
        />

        <div class="control pl-3">
          <input class="input" type="number" [(ngModel)]="speed" />
        </div>
      </div>
    </div>
  </div>

  <div class="column"></div>
</div>
